import { Routes, Route } from "react-router-dom";
import Navigation from "./components/navigation";
import Main from "./pages/main";

function App() {
  return (
    <div className="body-container">
      <Navigation />
      <Routes>
        <Route path="/" element={<Main />}></Route>
      </Routes>
    </div>
  );
}

export default App;
